import { Navigate } from "react-router-dom";

function PraivateRouts({ children }){
    const isLogin=(username)=>{
        if(username=='admin')return true
        return false
      }
      return(
        <>{isLogin("Ahmad") ? children : <Navigate to={'/'}/>}</>
      )
}
export default PraivateRouts;
